script: |
  super -f text -I q6067.spq | sort > q6067.out

inputs:
  - name: q6067.spq
    data: |
      SELECT DISTINCT COUNT ( ( CAST ( col1 AS INTEGER ) ) ) FROM tab0 (FORMAT parquet) WHERE - col2 NOT BETWEEN ( + col0 / - 82 ) AND NULL;
  - name: tab0

outputs:
  - name: q6067.out
    data: |
      3
